APP.factory("TPL",[function(){return{content:'\n<div class="jqueryData">\n    <div>\n        <div class="button" onclick="getData()">Get Data from Server JQuery</div>\n    </div>\n    <div id="serverData"></div>\n</div>\n<div class="angularData">\n    <div>\n        <div class="button" ng-click="getAngularData()">Get Data from Server Angular</div>\n    </div>\n    <div id="serverDataAngular">{{angularData}}</div>\n    <div>\n        <div class="button" ng-click="postAngularData()">Post Data</div>\n        <input type="text" name="something" ng-model="something"></input>\n    </div>\n</div>\n<div class="testData">\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[0].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[0].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[0].sport" />\n    </div>\n\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[1].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[1].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[1].sport" />\n    </div>\n\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[2].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[2].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[2].sport" />\n    </div>\n</div>\n<!--Div that will hold the pie chart-->\n<div id="chart_div" style="width:500; height:400"> first chart here</div>\n<div id="chart_div2" style="width:500; height:400"> second chart here</div>\n<div id="chart_div3" style="width:500; height:400"> third chart here</div>\n'}}]);